●e-sign(電子サイン)機能が加わり、複数のデバイスにまたがるシームレスな使用が可能に。<br>●基本的なPDF作成・編集機能だけでなく、高精度なOCR機能を使用してスキャンした紙の文書を検索可能なPDFファイルに変換、入力可能なPDFフォームを簡単に作成してデータ収集を効率化するといった機能を利用可能。さらに、様々な形式のファイルを1つのPDFファイルに結合して管理したり、高度なセキュリティ機能でデータを保護することも。<br>●対応OS／Microsoft Windows Server 2008 R2（64bit）/2012（64bit）/2012 R2（64bit）、Windows 7（32bitおよび64bit）/8（32bitおよび64bit）/10（32bitおよび64bit）<BR>●CPU／1.5GHz以上のプロセッサー<BR>●メモリ／1GBのRAM<BR>●HDD／4.5GBのハードディスク空き容量<BR>●ディスプレイ解像度／1024×768の画面解像度<BR>●ドライブ／DVD-ROM<BR>※最新の対応OSにつきましてはメーカーホームページをご確認ください。<br>●メーカー／アドビシステムズ<br>●型番／AD16R9M<br>●JANコード／5051254627661<br><br>※メーカー都合によりパッケージ・仕様等が予告なく変更される場合がございます。ご了承ください。<br><br>本商品は自社サイトでも販売しているため、ご注文のタイミングにより、発送までにお時間をいただいたり、やむをえずキャンセルさせていただく場合がございます。<br><br>※沖縄へのお届けは別途1620円(税込)の送料がかかります。<p>お買い物マラソン等イベント開催中は、ご注文の集中により発送手続き、お問い合わせの回答にお時間をいただく場合がございます。ご了承ください。</p>

