●専用高速カラースキャナ付属<br>●登録している名刺レコードの履歴フィールドに対して面会後およびその後の商談情報等を簡単に入力する機能を搭載。添付ファイル機能と組み合わせれば、簡易的な営業支援ツール(SFA)としてご利用可能。<br>●スマートフォンアプリケーション「やさしく名刺ファイリング Mobile LE」で、スマートフォンのカメラで撮影した名刺を文字認識(OCR)し、データベースとして名刺を管理することができます。<br>●4ヵ国語の名刺に対応。(日本語・英語(アメリカ・カナダ)・中国語(中国/香港/台湾)・韓国語)<br>●名刺の電子化によるすばやい検索。名刺を電子化することで、氏名・社名で素早く検索することが可能です。<br>●電子化によるセキュリティ強化。データベース保護・閲覧制限・アクセスログ機能を搭載することで名刺データのセキュリティを強化することが可能です。<br>●ネットワークによる情報共有。部署別・プロジェクト別など名刺データベースを共有することが可能です。<br>●名刺データベースの活用。電子化した名刺データは、宛名印刷・経路検索・地図表示・IP電話連携など様々なアプリケーションと連携し業務の効率化を実現します。<br>●対応OS／Windows 8.1、8、7、Vista<BR>●メモリ／1GB以上(64bit版Windows 7/8/8.1は2GB以上)<BR>●HDD／約630MB以上<BR>●ディスプレイ解像度／1024×768ピクセル以上<BR>●ドライブ／CD-ROMドライブ<BR>●対応スキャナ／TWAIN規格ドライバで動作するスキャナ<br>[専用高速カラースキャナ仕様]<br>●読取モード／片面、カラー/グレー/白黒<br>●読み取り可能サイズ／幅105×長さ1000mm(厚さ0.08～1.2mm)<br>●読取枚数／1枚<br>●光学解像度／600dpi×600dpi(最大)<br>●インターフェース／USB2.0<br>●電源／USBバスパワー<br>●消費電力／最大2.5W<br>●サイズ／W174.5×D60.5×H38.5mm<br>●重量／約194g<br>●使用環境／温度10～40度<br>●付属品／USBケーブル<br>※インストールには管理者(Administrator)権限が必要です。<br>※Internet Explorer 7.0以上、.NET Framework 4.0が必要です。<br>※アクティベーションを行うためにインターネット接続環境が必要です。<br>●メーカー／メディアドライブ<br>●JANコード／4946557029490<br><br>※メーカー都合によりパッケージ・仕様等が予告なく変更される場合がございます。ご了承ください。<br><br>※本商品は自社サイトでも販売しているため、ご注文のタイミングにより、発送までにお時間をいただいたり、やむをえずキャンセルさせていただく場合がございます。<br><br>※沖縄へのお届けは別途1620円(税込)の送料がかかります。<br><br>※本商品はメーカーより取寄せ後の発送となるため、配送日はご指定頂けません。予めご了承ください。<p>お買い物マラソン等イベント開催中は、ご注文の集中により発送手続き、お問い合わせの回答にお時間をいただく場合がございます。ご了承ください。</p>

